pragma solidity ^0.5.0;

contract TrivialGame {
    address public playerOne;
    address public playerTwo;
    address public winner;

    ///////////////// Events
    event GamePlayed(
        address playerOne,
        address playerTwo
    );

    event checkAddedPlayer (address player);

    // The constructor is responsible for setting the players of the game
    constructor() public {
        playerOne = address(0);
        playerTwo = address(0);
        winner = address(0);
    }

    function addPlayer() public returns (bool result) {
        if (playerOne == address(0)) {
            playerOne = msg.sender;
            emit checkAddedPlayer(playerOne);
        } else if (playerTwo == address(0)) {
            playerTwo = msg.sender;
            emit checkAddedPlayer(playerTwo);
        } else {
            return false;
        }
        return true;
    }

    // This is where the actual game logic takes place
    function play() 
    public
    {
        winner = playerOne;
        emit GamePlayed(playerOne, playerTwo);
    }
}
